### Pydeck Visualisation

With the correct geometry format, the scatterplot is trivial.

::: {#b1b2f97e .cell execution_count=4}
``` {.python .cell-code}
scatter = pdk.Layer(
    "ScatterplotLayer",
    centroids,
    pickable=True,
    stroked=True,
    filled=True,
    line_width_min_pixels=1,
    get_position="pydeck_geometry",
    get_fill_color=[255, 140, 0],
    get_line_color=[255, 140, 0],
    radius_min_pixels=3,
    opacity=0.1,
)
# Set the viewport location
view_state = pdk.ViewState(
    longitude=-2.84,
    latitude=52.42,
    zoom=6.5,
    max_zoom=15,
    pitch=0,
    bearing=0,
)
tooltip = {
    "text": "LSOA21CD: {LSOA21CD}"
}
# Render
r = pdk.Deck(
    layers=scatter, initial_view_state=view_state, tooltip=tooltip
)
r
```

